import React from 'react';
import './App.css'; // Import the CSS styles

function App() {
  const handleOutfitClick = () => {
    alert('Outfit of the Day clicked!');
  };

  const handleActivityClick = () => {
    alert('Activity Suggestions clicked!');
  };

  return (
    <div className="app">
      <header className="header">
        <div className="weather-icon">
          <img src="cloud-icon.png" alt="Weather Icon" />
        </div>
        <div className="weather-info">
          <h1>Outfit of the Day</h1>
          <p>Location: [Your Location]</p>
          <p>Temperature: [Temp]Â°C</p>
          <p>Condition: [Condition]</p>
        </div>
      </header>

      <main className="recommendations">
        <h2>Daily Recommendations</h2>
        <p>All day Location Weather</p>
        <div className="cards">
          <div className="card" onClick={handleOutfitClick}>
            <img src="coat-image.jpg" alt="Outfit" />
            <h3>Outfit of the Day</h3>
            <p>Based on the weather</p>
          </div>
          <div className="card" onClick={handleActivityClick}>
            <img src="dress-image.jpg" alt="Activity" />
            <h3>Activity Suggestions</h3>
            <p>Based on the weather</p>
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
